  const Container = styled.div`
  overflow: hidden;

  justify-content: space-between;
  padding-bottom:10vw;;
      @media (min-width: 1px) and (max-width: 426px) {


        }
  `

  const Para =styled.p`
  font-size:0.8vw;
  color:black;
  letter-spacing: 1px;
  line-height:1.5vw;
  font-family:arial;
  margin:1vw 0% 1vw 0%;
  @media (min-width: 1px) and (max-width: 426px) {
    font-size: 4vw;
    line-height: 5vw;

